def merge_the_tools(string, k):
    # Iterate over the string in chunks of size k
    for i in range(0, len(string), k):
        # Get the substring of length k
        part = string[i:i+k]
        
        # Remove duplicates while maintaining order
        unique_part = []
        for letter in part:
            if letter not in unique_part:
                unique_part.append(letter)
        
        # Print the result for each part
        print("".join(unique_part))


s = ""
k = 3333
merge_the_tools(s, k)